import {
    Navbar,
    Nav,
    NavItem,
    NavLink,
} from 'reactstrap';
import React from 'react';

export const MainNav = () => {
    return (
        <div>
            <Navbar>
                {/* <Nav navbar horizontal className="navigation"> */}
                    <NavItem>
                        <NavLink href="/components/">Home</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="https://github.com/reactstrap/reactstrap">
                            Work
                        </NavLink>
                    </NavItem>
                {/* </Nav> */}
            </Navbar>
        </div>
    );
};
